import React from 'react';
import { render } from '@testing-library/react';

function App() {
  render() ;
  return (
    <div class="React">
      <span><h1>Would you like pareve cheese?</h1></span>
      <h1>
     <label for = "yes">Yes</label>
     <input type = "radio" name = "loud" id = "yes"/>
     <label for = "no">No</label>
     <input type = "radio" name = "loud" id = "no"/>
     </h1>
    </div>
  )
}

export default App;
